import React from 'react'
import About from './About'
import Projects from './Projects'

function Pagecontent() {
    return (
        <>
            <div className="w3-content w3-padding" style={{ maxWidth: 1564 }}></div>
            <Projects></Projects>
            <About></About>


        </>
    )
}

export default Pagecontent
